@notice Publish a new AgentGeneratedIntent for trading
@notice Automatically fill these variables of the `AgentGeneratedIntent` struct:
        `orderId`: auto increment by 1, `orderStatus`: set to 0
@dev Adds a new order to the `AgentGeneratedIntentList`. Only callable by the AI, owner, or Master42.
     Emits an `AGIPublished` event with the order id.
@param _orderType Type of the order (0 for regular trades)
@param _assetToSell Address of the asset to sell, could be $SVF42 or whitelisted asset
@param _amountToSell Amount of the asset to sell (inputAmount)
@param _assetToBuy Address of the asset to buy, could be $SVF42 or whitelisted asset

